import React, { useState } from 'react';
import ActPerc from './ActPerc';
import './ProgPerc.css';

const ProgPerc = () => {
  const [calculatedValue, setCalculatedValue] = useState(0);

  const updateCalculatedValue = () => {
    const newValue = Math.floor(Math.random() * 100) + 1;
    setCalculatedValue(newValue);
  };

  const maxValue = 100;

  return (
    <div className="ProgPerc">
      <h3>Active Percentage</h3>
      <button onClick={updateCalculatedValue}>Update Calculated Value</button>
      <ActPerc calculatedValue={calculatedValue} maxValue={maxValue} />
    </div>
  );
};

export default ProgPerc;
